import { ScrollArea } from "@/components/ui/scroll-area";
import { Avatar, AvatarImage } from "@/components/ui/avatar";

// Mock data for messages
const messages = ref([
  { id: 1, text: "Hello, how can I help you today?", sender: "bot" },
  { id: 2, text: "I would like to know more about your services.", sender: "user" },
  { id: 3, text: "Sure! We offer a wide range of services including web development, design, and marketing.", sender: "bot" },
]);

// Reference to the input for new messages
const newMessage = ref('');

// Function to add a new message
const sendMessage = () => {
  if (newMessage.value.trim() !== '') {
    messages.value.push({
      id: messages.value.length + 1,
      text: newMessage.value,
      sender: "user"
    });
    newMessage.value = ''; // Reset input after sending
  }
};

// Function to simulate bot response
const simulateBotResponse = () => {
  messages.value.push({
    id: messages.value.length + 1,
    text: "This is a simulated response from the bot.",
    sender: "bot"
  });
};
